//import logo from './web_logo.svg';
//import './App.css';
import React from 'react';
import Leftheader from './Leftheader';
import Topnav from './Topnav';
import Sidebarnav from './Sidebarnav';
import Combined from './components/Combined';
import Effluent from './components/Effluent';
import Solids from './components/Solids';
import Ammonia from './components/Ammonia';
import Bod from './components/Bod';
import './assets/css/style.css';
import './assets/css/custom.css';

import {AreaChart, Area, XAxis, YAxis, 
    CartesianGrid, Tooltip} from 'recharts';

//import './assets/js/jquery.min.js';
//import './assets/js/main.js';

const App = () => {
  
    // Sample data
    const data = [
        {name:"A", x:30, y:70},
        {name:"B", x:12, y:88},
        {name:"C", x:15, y:85},
        {name:"D", x:35, y:65},
        {name:"E", x:54, y:46},
        {name:"F", x:72, y:28},
        {name:"G", x:32, y:68}
    ];
   
   
    return (
    <AreaChart width={500} height={700} data={data}>
        <CartesianGrid/>
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Area dataKey="x" stackId="1" 
            stroke="green" fill="green" />
        <Area dataKey="y" stackId="1" 
            stroke="blue" fill="blue" />
    </AreaChart>
    );
}
   
export default App;


